class DataProcessor:
    def __init__(self):
        self.data = []

class DataProcessor:
    def load_csv(self, file_path: str, delimiter: str = ',') -> None:
        with open(file_path, 'r', encoding='utf-8') as file:
            reader = csv.DictReader(file, delimiter=delimiter)
            self.data = [row for row in reader]

class DataProcessor:
    def load_json(self, file_path: str) -> None:
        with open(file_path, 'r', encoding='utf-8') as file:
            self.data = json.load(file)

class DataProcessor:
    def save_json(self, file_path: str, indent: int = 4) -> None:
        with open(file_path, 'w', encoding='utf-8') as file:
            json.dump(self.data, file, indent=indent)

class DataProcessor:
    def sort_data(self, key: str, reverse: bool = False) -> None:
        self.data.sort(key=lambda x: x.get(key, None), reverse=reverse)

class MathOperations:
    def prime_numbers(limit: int) -> List[int]:
        if limit < 2:
            return []
        primes = []
        for num in range(2, limit + 1):
            is_prime = True
            for i in range(2, int(math.sqrt(num)) + 1):
                if num % i == 0:
                    is_prime = False
                    break
            if is_prime:
                primes.append(num)

        return primes

class MathOperations:
    def fibonacci(n: int) -> int:
        if n <= 0:
            raise ValueError("n musi być większe od 0")
        if n == 1 or n == 2:
            return 1
        a, b = 1, 1
        for _ in range(3, n + 1):
            a, b = b, a + b
        return b

class MathOperations:
    def gcd(a: int, b: int) -> int:
        return math.gcd(a, b)

class MathOperations:
    def lcm(a: int, b: int) -> int:
        return abs(a * b) // MathOperations.gcd(a, b)

class MathOperations:
    def quadratic_roots(a: float, b: float, c: float) -> Tuple[Union[float, complex], Union[float, complex]]:
        if a == 0:
            raise ValueError("To nie jest równanie kwadratowe")
        delta = b ** 2 - 4 * a * c
        if delta < 0:
            sqrt_delta = math.sqrt(-delta) * 1j
        else:
            sqrt_delta = math.sqrt(delta)
        x1 = (-b + sqrt_delta) / (2 * a)
        x2 = (-b - sqrt_delta) / (2 * a)
        return x1, x2

class MathOperations:
    def is_perfect_number(n: int) -> bool:
        if n <= 1:
            return False
        divisors_sum = 1
        for i in range(2, int(math.sqrt(n)) + 1):
            if n % i == 0:
                divisors_sum += i
                if i != n // i:
                    divisors_sum += n // i
        return divisors_sum == n

class String:
    def reverse_string(text: str) -> str:
        return text[::-1]

class String:
    def is_palindrome(s: str) -> bool:
        return s == ''.join(reversed(s))

class String:
    def count_words(text: str) -> int:
        return len(text.split())

class String:
    def capitalize_words(text: str) -> str:
        return text.title()

class String:
    def get_total_words(words: list) -> int:
        return len(words)

class String:
    def get_unique_words(words: list) -> int:
        return len(set(words))

class String:
    def get_longest_word(words: list) -> str:
        if not words:
            return ''
        return max(words, key=len)

class String:
    def get_shortest_word(words: list) -> str:
        if not words:
            return ''
        return min(words, key=len)

class BankAccount:
    def __init__(self, owner, balance=0):
        self.owner = owner
        self.balance = balance
        self.transactions = []

class BankAccount:
    def deposit(self, amount):
        if amount <= 0:
            raise ValueError("Kwota musi być dodatnia")
        self.balance += amount
        self.transactions.append(f"Wpłata: {amount} zł")

class BankAccount:
    def withdraw(self, amount):
        if amount > self.balance:
            raise ValueError("Brak środków")
        self.balance -= amount
        self.transactions.append(f"Wypłata: {amount} zł")

class BankAccount:
    def transfer(self, amount, other_account):
        self.withdraw(amount)
        other_account.deposit(amount)
        self.transactions.append(f"Przelew do {other_account.owner}: {amount} zł")

class BankAccount:
    def get_balance(self):
        return self.balance

class BankAccount:
    def get_transaction_history(self):
        return self.transactions.copy()

class BankAccount:
    def __str__(self):
        return f"Konto: {self.owner}, saldo: {self.balance} zł"

class Calculator:
    def __init__(self):
        self.memory = 0
        self.history = []

class Calculator:
    def add(self, a, b):
        result = a + b
        self.history.append(f"{a} + {b} = {result}")
        return result

class Calculator:
    def subtract(self, a, b):
        result = a - b
        self.history.append(f"{a} - {b} = {result}")
        return result

class Calculator:
    def multiply(self, a, b):
        result = a * b
        self.history.append(f"{a} * {b} = {result}")
        return result

class Calculator:
    def divide(self, a, b):
        if b == 0:
            raise ValueError("Nie można dzielić przez zero")
        result = a / b
        self.history.append(f"{a} / {b} = {result}")
        return result

class Calculator:
    def power(self, base, exponent):
        result = base ** exponent
        self.history.append(f"{base} ^ {exponent} = {result}")
        return result

class Calculator:
    def sqrt(self, n):
        if n < 0:
            raise ValueError("Nie można obliczyć pierwiastka z liczby ujemnej")
        result = math.sqrt(n)
        self.history.append(f"√{n} = {result}")
        return result

class Calculator:
    def logarithm(self, n, base=math.e):
        if n <= 0:
            raise ValueError("Logarytm tylko dla liczb dodatnich")
        result = math.log(n, base)
        self.history.append(f"log_{base}({n}) = {result}")
        return result

class Calculator:
    def factorial(self, n):
        if n < 0:
            raise ValueError("Silnia tylko dla liczb >= 0")
        result = math.factorial(n)
        self.history.append(f"{n}! = {result}")
        return result

class Calculator:
    def memory_store(self, value):
        self.memory = value

class Calculator:
    def memory_recall(self):
        return self.memory

class Calculator:
    def memory_clear(self):
        self.memory = 0

class Calculator:
    def get_history(self):
        return self.history.copy()

class Calculator:
    def clear_history(self):
        self.history.clear()

class Rectangle:
    def __init__(self, width, height):
        self.width = width
        self.height = height

class Rectangle:
    def area(self):
        return self.width * self.height

class Rectangle:
    def perimeter(self):
        return 2 * (self.width + self.height)

class Rectangle:
    def is_square(self):
        return self.width == self.height

class Rectangle:
    def resize(self, new_width, new_height):
        self.width = new_width
        self.height = new_height

class Rectangle:
    def scale(self, factor):
        self.width *= factor
        self.height *= factor

class Rectangle:
    def diagonal(self):
        return (self.width**2 + self.height**2) ** 0.5

class Rectangle:
    def __str__(self):
        return f"Prostokąt {self.width} x {self.height}, pole: {self.area()}, obwód: {self.perimeter()}"

class DateTime:
    def is_leap_year(year: int) -> bool:
        return calendar.isleap(year)

class DateTime:
    def days_between(date1: date, date2: date) -> int:
        return abs((date2 - date1).days)

class DateTime:
    def get_weekday(target_date: date) -> str:
        days = ['Poniedziałek', 'Wtorek', 'Środa', 'Czwartek', 'Piątek', 'Sobota', 'Niedziela']
        return days[target_date.weekday()]

class DateTime:
    def format_datetime(dt: datetime, format_string: str = '%Y-%m-%d %H:%M:%S') -> str:
        return dt.strftime(format_string)

class DateTime:
    def get_quarter(date_obj: date) -> int:
        return (date_obj.month - 1) // 3 + 1

class DateTime:
    def get_days_in_month(year: int, month: int) -> int:
        return calendar.monthrange(year, month)[1]

class DateTime:
    def is_weekend(date_obj: date) -> bool:
        return date_obj.weekday() >= 5

class DateTime:
    def time_to_event(event_date: datetime) -> str:
        now = datetime.now()
        if event_date < now:
            return "Wydarzenie już się odbyło"

        diff = event_date - now
        total_seconds = int(diff.total_seconds())

        days = total_seconds // 86400
        hours = (total_seconds % 86400) // 3600
        minutes = (total_seconds % 3600) // 60

        parts = []
        if days > 0:
            parts.append(f"{days} dni")
        if hours > 0:
            parts.append(f"{hours} godzin")
        if minutes > 0 or not parts:
            parts.append(f"{minutes} minut")

        return ", ".join(parts)
